control.onControlLoad:
//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();

control.onClick:
return;
if (!g5.tableClick.valid) {
    alert("请选择有效的记录进行操作");
    return;
}
var userId = query.dataset.getData(0,g5.tableClick.y);
var status = query.dataset.getData(1,g5.tableClick.y);
if (status == "DISABLED") {
    if (!confirm("该用户处于封号状态，是否进行解封操作？")) {
        return;
    }
    if (disableUser.busy) return;
    disableUser.userId = userId;
    disableUser.operation = "0";
    disableUser.onComplete = function() {
        query();
    }
    disableUser();
} else if (status == "IDL") {
    if (!confirm("该用户处于正常状态，是否进行封号操作？")) {
        return;
    }
    if (disableUser.busy) return;
    disableUser.userId = userId;
    disableUser.operation = "1";
    disableUser.onComplete = function() {
        query();
    }
    disableUser();
}

if (eb.isEmpty(g5.userId) || isNaN(g5.userId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
ee.setText(ee.getControl("panel10"), g5.userId);
ee.setEditText(ee.getControl("edit2"), g5.userName);
ee.setEditText(ee.getControl("edit4"), "");
ee.setEditText(ee.getControl("edit5"), "");
ee.setEditText(ee.getControl("edit6"), g5.nickName);
ee.setEditText(ee.getControl("edit7"), g5.mobile);
ee.setEditText(ee.getControl("edit8"), "");
ee.setEditText(ee.getControl("edit1"), g5.note);

g5.operation = "edit";
ee.showAni(ee.getControl("panel1"));

if (eb.isEmpty(g5.userId) || isNaN(g5.userId)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("删除操作将导致不可返回的后果，如需恢复数据只有联系网管，您是否继续这个危险的操作？")) {
    return;
}
