    ee.setText(sender, "");
    return;
}
var t1 = query.dataset.getData(4,y);
var t2 = query.dataset.getData(5,y);

if (t1 == "ADMIN") {
    t1 = "管理员";
}
if (t2 == "DISABLED") {
    t2 = "<font color='#C00000'>封号</font>";
} else if (t2 == "ENABLED") {
    t2 = "<font color='#00A000'>解封</font>";
} else if (t2 == "NEWA") {
    t2 = "创建后台账号";
} else if (t2 == "UNDEL") {
    t2 = "<font color='#00A000'>恢复管理员账号</font>";
} else if (t2 == "DEL") {
    t2 = "<font color='#C00000'>删除管理员账号</font>";
} else if (t2 == "UNFREEZE") {
    t2 = "<font color='#00A000'>解除冻结</font>";
} else if (t2 == "FREEZE") {
    t2 = "<font color='#C00000'>冻结账号</font>";
} else if (t2 == "DelAllF") {
    t2 = "<font color='#C00000'>强制删除关注</font>";
} else if (t2 == "SetStatus") {
    t2 = "<font color='#C00000'>强置用户状态</font>";
}

ee.setText(sender, t1 + "\n" + t2);

if (!query.dataset) {
    text = "";
    return;
}
